import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import User from '../components/User';
import { user_summary, user_projects, user_statistics } from '../modules/user';

const UserContainer = ({ id, page, user }) => {
    const summary = useSelector(state => state.summary);
    const projects = useSelector(state => state.projects);
    const statistics = useSelector(state => state.statistics);

    const dispatch = useDispatch();

    const userSummary = user => dispatch(user_summary);
    const userProjects = user => dispatch(user_projects);
    const userStatistics = user => dispatch(user_statistics);

    return (
        <User
            id={id}
            page={page}
            user={user}
        />
    )
}

export default UserContainer;
